{"settings":"{
  "workbench.colorTheme": "Rosé Pine",
  "window.menuBarVisibility": "toggle",
  "editor.scrollbar.vertical": "hidden",
  "editor.scrollbar.verticalScrollbarSize": 0,
  "security.workspace.trust.untrustedFiles": "newWindow",
  "security.workspace.trust.startupPrompt": "never",
  "security.workspace.trust.enabled": false,
  "editor.fontFamily": "JetBrains Mono",
  "editor.fontLigatures": true,
  "extensions.autoUpdate": "onlySelectedExtensions",
  "terminal.external.linuxExec": "kitty",
  "terminal.explorerKind": "both",
  "terminal.sourceControlRepositoriesKind": "both",
  "telemetry.telemetryLevel": "off",
  "terminal.integrated.profiles.linux": {
    "bash": {
      "path": "bash",
      "icon": "terminal-bash"
    },
    "zsh": {
      "path": "zsh"
    },
    "fish": {
      "path": "fish"
    },
    "tmux": {
      "path": "tmux",
      "icon": "terminal-tmux"
    },
    "pwsh": {
      "path": "pwsh",
      "icon": "terminal-powershell"
    },
    "fish (2)": {
      "path": "/bin/fish"
    }
  },
  "terminal.integrated.defaultProfile.linux": "fish (2)",
  "editor.minimap.scale": 2,
  "code-runner.ignoreSelection": true,
  "workbench.colorCustomizations": {},
  "editor.defaultFormatter": "VisualStudioExptTeam.vscodeintellicode",
  "workbench.iconTheme": "vscode-icons",
  "github.copilot.enable": {
    "*": true,
    "plaintext": false,
    "markdown": false,
    "scminput": false
  },
  "latex-workshop.latex.outDir": "./build",
  "git.openRepositoryInParentFolders": "never",
  "vsicons.dontShowNewVersionMessage": true,
  "[c]": {
    "editor.defaultFormatter": "ms-vscode.cpptools"
  },
  "editor.formatOnType": true,
  "explorer.confirmDragAndDrop": false,
  "explorer.confirmDelete": false,
  "[php]": {
    "editor.defaultFormatter": "DEVSENSE.phptools-vscode"
  },
  "cmake.showOptionsMovedNotification": false,
  "files.exclude": {
    "**/.git": false
  },
  "[rust]": {
    "editor.defaultFormatter": "rust-lang.rust-analyzer"
  },
  "editor.formatOnSave": true,
  "cmake.configureOnOpen": false,
  "gitlens.advanced.messages": {
    "suppressLineUncommittedWarning": true
  },
  "[java]": {
    "editor.defaultFormatter": "redhat.java"
  },
  "editor.largeFileOptimizations": false,
  "[latex]": {
    "editor.defaultFormatter": "James-Yu.latex-workshop"
  },
  "workbench.editorAssociations": {
    "*.dll": "default"
  },
  "editor.lineNumbers": "relative",
  "[python]": {
    "editor.defaultFormatter": "ms-python.black-formatter"
  },
  "[jsonc]": {
    "editor.defaultFormatter": "esbenp.prettier-vscode"
  },
  "prettier.printWidth": 80,
  "vim.normalModeKeyBindingsNonRecursive": [
    {
      "before": [
        "j"
      ],
      "after": [
        "h"
      ]
    },
    {
      "before": [
        "k"
      ],
      "after": [
        "j"
      ]
    },
    {
      "before": [
        "l"
      ],
      "after": [
        "k"
      ]
    },
    {
      "before": [
        "ö"
      ],
      "after": [
        "l"
      ]
    },
    {
      "before": [
        "<C-d>"
      ],
      "after": [
        "<C-d>",
        "z",
        "z"
      ]
    },
    {
      "before": [
        "<C-u>"
      ],
      "after": [
        "<C-u>",
        "z",
        "z"
      ]
    }
  ],
  "vim.visualModeKeyBindingsNonRecursive": [
    {
      "before": [
        "j"
      ],
      "after": [
        "h"
      ]
    },
    {
      "before": [
        "k"
      ],
      "after": [
        "j"
      ]
    },
    {
      "before": [
        "l"
      ],
      "after": [
        "k"
      ]
    },
    {
      "before": [
        "ö"
      ],
      "after": [
        "l"
      ]
    }
  ],
  "nvim.commandLineModeKeyBindingsNonRecursive": [
    {
      "before": [
        "h"
      ],
      "after": [
        "j"
      ]
    },
    {
      "before": [
        "j"
      ],
      "after": [
        "k"
      ]
    },
    {
      "before": [
        "k"
      ],
      "after": [
        "l"
      ]
    },
    {
      "before": [
        "l"
      ],
      "after": [
        "ö"
      ]
    }
  ],
  "extensions.experimental.affinity": {
    "asvetliakov.vscode-neovim": 1
  },
  "vscode-neovim.afterInitConfig": [
    "vim.keymap.set('n', '<C-u>', '<C-u>zz')"
  ],
  "[html]": {
    "editor.defaultFormatter": "vscode.html-language-features"
  }
}"}
